import React, { Component } from 'react';
import ProductTop from './ProductTop.js';
import Tag from './Tag.js';
import Carousel from './Carousel.js';
import ProductBottom from './ProductBottom.js';

class Home extends Component {
    render() {
        return (
            <div>
                <ProductTop />
                <Tag />
                <Carousel />
                <ProductBottom />
            </div>
        );
    }
}

export default Home;
